--
-- Name: get_ingest_health(); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.get_ingest_health() RETURNS TABLE(source text, minutes_stale integer, last_success_at timestamp with time zone, last_error text, records bigint, last_event timestamp with time zone)
    LANGUAGE plpgsql SECURITY DEFINER
    AS $$
BEGIN
  RETURN QUERY
  SELECT 
    sources.source_name,
    CASE 
      WHEN s.last_updated IS NULL THEN NULL
      ELSE EXTRACT(EPOCH FROM (NOW() - s.last_updated))::INTEGER / 60
    END as minutes_stale,
    s.last_updated as last_success_at,
    s.error_message as last_error,
    COALESCE(e.record_count, 0) as records,
    e.latest_event
  FROM (
    SELECT 
      unnest(ARRAY['ieso', 'aeso', 'hydroquebec', 'bchydro', 'cer', 'manitoba', 'saskpower']) as source_name
  ) sources
  LEFT JOIN ingest_status s ON s.source = sources.source_name
  LEFT JOIN (
    SELECT 
      ee.source,
      COUNT(*) as record_count,
      MAX(ee.ts) as latest_event
    FROM energy_events ee
    GROUP BY ee.source
  ) e ON e.source = sources.source_name
  ORDER BY sources.source_name;
END;
$$;


