--
-- Name: mv_llm_daily_spend; Type: MATERIALIZED VIEW; Schema: public; Owner: postgres
--

CREATE MATERIALIZED VIEW public.mv_llm_daily_spend AS
 SELECT date_trunc('day'::text, ts) AS day,
    endpoint,
    sum(COALESCE(token_cost, (0)::numeric)) AS tokens,
    sum(COALESCE(cost_usd, (0)::numeric)) AS spend_usd,
    count(*) AS calls
   FROM public.llm_call_log
  GROUP BY (date_trunc('day'::text, ts)), endpoint
  ORDER BY (date_trunc('day'::text, ts)) DESC
  WITH NO DATA;


ALTER MATERIALIZED VIEW public.mv_llm_daily_spend OWNER TO postgres;

